 DROP TABLE IF EXISTS tmp_msd_products;

CREATE TABLE tmp_msd_products
(
  action character varying,
  msd_code character varying,
  msd_name character varying,
  elmis_name character varying,
  elmis_code character varying,
  elmis_id integer,
  unit character varying,
  packsize double precision,
  uom character varying,
  sql_update_product text,
  sql_update_requ text,
  ignore boolean DEFAULT false
)
WITH (
  OIDS=FALSE
);
ALTER TABLE tmp_msd_products
  OWNER TO postgres;

